    <div className="w-full h-screen flex flex-col background relative">
      <h1 className="bg-white rounded-lg absolute w-11/12 text-center px-10 py-2 mx-auto text-4xl font-bold items-center ">RANDOM GIFS</h1>

      <div className="flex flex-col">
        <Random />
        <Tag />
      </div>
    </div>
  );
}
